import "./Expenses.css";

function Expenses({items}) {
    console.log(item)
  return (
    <div>
      <ExpenseItem
        title={items[0].title}
              amount={item[0].amount}
        date={item[0].date}
      />
      <ExpenseItem
              title={item[1].title}
        amount={item[1].amount}
        date={item[1].date}
      />
      <ExpenseItem
        title={item[2].title}
        amount={item[2].amount}
        date={item[2].date}
      />
      <ExpenseItem
        title={item[3].title}
        amount={item[3].amount}
        date={item[3].date}
      />
    </div>
  );
}

export default Expenses;
